// Avatar.tsx
import React from 'react';

interface AvatarProps {
  avatarInfo: {
    imageUrl: string;
    altText: string;
    className: string;
  };
}

const Avatar: React.FC<AvatarProps> = ({ avatarInfo }) => {
  const { imageUrl, altText, className } = avatarInfo;

  return (
    <img
      className={className}
      src={imageUrl}
      alt={altText}
    />
  );
};

export default Avatar;
